import styles from "./About.module.css";
import imagen from "../imagen/imagen-perfilLinkedin.png";

 const About = () => {
     return (
        <div className={styles.divPadre}>
        <div className={styles.div} >
        <h1>MI PERFIL</h1>
        <p> Me llamo Ignacio Martin , esta es mi aplicacion  hecha con ganas y mucha voluntad...<br/>
        esta aplicacion trata sobre los personajes de Rick y Morty...<br/>
        Espero que les guste...    
        </p>
        <img  className={styles.imagen}  src={imagen}/>
        </div>
        </div>
 )
 }

 export default About;
